import React from "react";
import { NavLink } from "react-router-dom";
import './Navbar.css'

const Navbar = () => {
  state={ clicked: false}

    handleClick = () =>{
        this.setState({clicked: !this.state.clicked})
    }
    return (
      <>
     <home className="home">
     <div className="home-row">
     <div className="col12 col-auto pad0">

     
     <div className="col9 d-flex pad10-15" id="navTarg" >
       <nav toolbar="(min-width: 1025px)" toolbarTarget="navTarg" className="d-flex w100 amp-sidebar-toolbar-target-hidden i-amphtml-toolbar">
     <NavLink className="navbar-brand" to ="/Home">
        <img src="JHT.png" alt="logo" className="i-amphtml-element i-amphtml-layout-fixed i-amphtml-layout-size-defined i-amphtml-built i-amphtml-layout" i-amphtml-layout="fixed" style={{width: '200px', height: '47.39px' , marginLeft:"74px", loaderDelayOffset:'600ms !important'}}/>
      </NavLink>
       
    
     
       <ul id="nav-ul" className="Mt50 d-flex">
        <li>
          <NavLink activeclassname='menu_active' className="nav-link" to="/home">HOME</NavLink>
        </li>

         <li>
	      <NavLink activeclassname='menu_active' className="nav-link" to="/about">ABOUT</NavLink>			                   									
        </li>

          <li>
          <NavLink activeclassname='menu_type' className="nav-link" to="/trucktype">TRUCKTYPE</NavLink>
         </li>

          <li>
          <NavLink activeclassname ='menu_active' className="nav-link" to="/contact">CONTACT</NavLink>
          </li></ul>
          </nav>
       </div>
      </div> 
     </div> 
     

     </home>
    </>
     );
};
export default Navbar;
